'use strict';
let csvParser = require('@gehtsoft/LuaxStdlib-node').csvParser;
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class CreateOrderCsvParser {
    fieldParser;
    constructor() {
        this.fieldParser = new csvParser();
        this.fieldParser.valueSeparator = ";";
    }
    parse(line) {
        let parts, idLine;
        if (line == null) {
            return null;
        }
        idLine = stdlib.trim(line);
        if (idLine == "0" || stdlib.len(idLine) == 0) {
            return null;
        }
        parts = this.fieldParser.splitLine(idLine);
        if (parts.length == 0) {
            return null;
        }
        return parts[0];
    }
}
module.exports = CreateOrderCsvParser
